package com.vandersoncamp.transporte.model;import com.vandersoncamp.transporte.enuns.TipoTransporteEnum;import javax.persistence.*;import javax.validation.constraints.NotNull;import java.io.Serializable;@Entity@Table(name = "CLIENTE_LINHAS")@SequenceGenerator(name = "SEQ_CLIENTES_LINHA", sequenceName = "SEQ_CLIENTES_LINHA", initialValue = 1, allocationSize = 1)public class ClienteLinha implements Serializable {    @Id    @Column(name = "ID")    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "SEQ_CLIENTES_LINHA")    private Long id;    @ManyToOne    @JoinColumn(name = "I_CLIENTE", nullable = false)    private Cliente cliente;    @NotNull    @Column(name = "TIPO_TRANSPORTE", length = 1, nullable = false)    @Enumerated(EnumType.ORDINAL)    private TipoTransporteEnum tipoTransporte;    @JoinColumn(name = "ID_LINHA_ONIBUS")    @ManyToOne(fetch = FetchType.EAGER, cascade = CascadeType.ALL)    private LinhaOnibus linhaOnibus;    @JoinColumn(name = "ID_LINHA_LOTACAO")    @ManyToOne(fetch = FetchType.EAGER, cascade = CascadeType.ALL)    private LinhaLotacao linhaLotacao;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public Cliente getCliente() {        return cliente;    }    public void setCliente(Cliente cliente) {        this.cliente = cliente;    }    public TipoTransporteEnum getTipoTransporte() {        return tipoTransporte;    }    public void setTipoTransporte(TipoTransporteEnum tipoTransporte) {        this.tipoTransporte = tipoTransporte;    }    public LinhaOnibus getLinhaOnibus() {        return linhaOnibus;    }    public void setLinhaOnibus(LinhaOnibus linhaOnibus) {        this.linhaOnibus = linhaOnibus;    }    public LinhaLotacao getLinhaLotacao() {        return linhaLotacao;    }    public void setLinhaLotacao(LinhaLotacao linhaLotacao) {        this.linhaLotacao = linhaLotacao;    }}